\[
\text{ Jim walks along the diagonal of the field. The length of the diagonal can be calculated using the Pythagorean theorem: }
\]
\[
\text{ Diagonal } = \sqrt{\text{Length}^2 + \text{Width}^2} = \sqrt{400^2 + 300^2} = \sqrt{160000 + 90000} = \sqrt{250000} = 500 \text{ feet.}
\]
\[
\text{ Marsha walks along the length and width of the field: }
\]
\[
\text{ Distance Marsha walks } = \text{Length} + \text{Width} = 400 + 300 = 700 \text{ feet.}
\]
\[
\text{ The difference in distance walked by Jim and Marsha is: }
\]
\[
\text{ Difference } = \text{Distance Marsha walks} - \text{Distance Jim walks} = 700 - 500 = 200 \text{ feet.}
\]
\[
\boxed{200}
\]
